import React, { useEffect, useState } from 'react'
import Card from '../Card/Card';

const RankedData = () => {
    const [data,setData]=useState([]);

    useEffect(()=>{
        fetch("http://localhost:5000/").then(res=>res.json()).then(info=>setData(info));
    },[])

  return (
    <div>
    {data.map((info, index) => {
      return <Card info={info} color={"info"} key={index} />;
    })}
  </div>
  )
}

export default RankedData
